import {BrowserRouter,Route,Routes,Link} from "react-router-dom";  

import Login from "./login";
import Backend from "./backend";

import Error from "./error";
import { useEffect,useState } from "react";


const Home=()=> {
  const [permession_state,set_permession_state]=useState(false)

  function select_route(){
    var permession=window.sessionStorage.getItem('permession')
    if(permession==="admin"){

      return(<Route exact={true} path="/backend/admin"element={<Backend/>}/>)
    }
    else if(permession==="manager"){
        return(<Route exact={true} path="/backend/manager"element={<Backend/>}/>)
    }
    else{
        return(<Route exact={true} path="/backend/personal"element={<Backend/>}/>)
    }
  }


  return (
      <BrowserRouter>
      <Routes>

        <Route exact={true} path="/" element={<Login />}/>
        <Route exact={true} path="/login" element={<Login permession_state={permession_state}/>}/>

        <Route exact={true} path="/backend/admin/:page"element={<Backend  access={'admin'}/>}/>
        <Route exact={true} path="/backend/manager/:page"element={<Backend access={'manager'}/>}/>
        <Route exact={true} path="/backend/personal/:page"element={<Backend  access={'personal'}/>}/>

        <Route exact={true} path="/backend/admin/:page/:article_page"element={<Backend  access={'admin'}/>}/>
        <Route exact={true} path="/backend/manager/:page/:article_page"element={<Backend access={'manager'}/>}/>

        <Route exact={true} path="*" element={<Error/>}/>



      </Routes>

      </BrowserRouter>
  )
}

export default Home;
